import React from 'react';
import './App.css';
import Landlogpage from './components/landlogPage'
import 'bootstrap/dist/css/bootstrap.min.css';
import Footer from './components/Footer'

function App() {
  return (
    <div className="App">
      <Landlogpage />
      <Footer />
    </div>
  );
}

export default App;
